import styled from 'styled-components';

export const LinkingWrapper = styled.div`
ul {
    list-style-type:none;
    display: flex;
    background-color: aqua;
}
li {
    display: flex;
    position: relative;
    font-size: 12px;
    margin-left: 10px;
    margin-right: 10px;
    a {
        text-decoration: none;
        color: black;
    }
}
`
export const Image = styled.image`
img {
  width: 30px;
  height: 30px;
}
`
